import styled from 'styled-components';
import { Scrollbars } from 'react-custom-scrollbars';


export const TileContainer = styled.div`
    width: 960px;
    display: flex;
    flex-wrap: wrap;
`;

export const ScrollBar = styled(Scrollbars)`
    width: 980px;

`;
